import { Component } from "react";
import TextFormField from "../../../shared/textformfield/TextFormField";
import SubmitFormButton from "../../../shared/submitformbutton/SubmitFormButton";

import "./RegisterForm.css"

class RegisterForm extends Component
{    
    render(){
        return (
            <form className = "register-form">
                <TextFormField fieldType = "phone" placeHolder = "Enter your phone number here" />
                <TextFormField fieldType = "password" placeHolder = "Enter your password here" />
                <TextFormField fieldType = "password" placeHolder = "Enter again your password here" />
                <SubmitFormButton />
            </form>
        )
    }
}

export default RegisterForm
